DELETE FROM GUIATBA_TransporteIntersecciones 
WHERE 
CodigoD IN ('5','6','7','9','10','17','24','26','45','53','59','67','70','75','91','98','100','111','115','129','152','195')
OR
CodigoO IN ('5','6','7','9','10','17','24','26','45','53','59','67','70','75','91','98','100','111','115','129','152','195')
--4442


INSERT INTO GUIATBA_TransporteIntersecciones (CodigoO, CodigoD)
SELECT DISTINCT o.Codigo, d.Codigo
FROM [GUIATBA_Transporte] o
INNER JOIN (
SELECT *
FROM [GUIATBA_Transporte]
) d
ON o.Ubicacion.STBuffer(0.001).STIntersects(d.Ubicacion.STBuffer(0.001)) = 1
WHERE
o.Codigo IN ('5','6','7','9','10','17','24','26','45','53','59','67','70','75','91','98','100','111','115','129','152','195')
OR 
d.Codigo IN ('5','6','7','9','10','17','24','26','45','53','59','67','70','75','91','98','100','111','115','129','152','195')
--4183